package com.txdot.isd.rts.services.data;import java.io.Serializable;import com.txdot.isd.rts.services.util.constants.CommonConstant;/* * PermitSearchKeys.java * * (c) Texas Department of Transportation 2010 * --------------------------------------------------------------------- * Change History: * Name			Date		Description * ------------	-----------	-------------------------------------------- * K Harrell	06/09/2010	Created * 							defect 10492 Ver 6.5.0 * --------------------------------------------------------------------- *//** * Data class to facilitate assignment of Key Data for Permit Searcyh * * @version	6.5.0			06/09/2010 * @author	Kathy Harrell * <br>Creation Date:		06/09/2010  *//* &PermitSearchKeys& */public class PermitSearchKeys implements Serializable{/* &PermitSearchKeys'ciBeginDate& */	private int ciBeginDate;/* &PermitSearchKeys'ciEndDate& */	private int ciEndDate;/* &PermitSearchKeys'csCustBsnName& */	private String csCustBsnName = new String();/* &PermitSearchKeys'csCustLstName& */	private String csCustLstName = new String();/* &PermitSearchKeys'csPrmtIssuanceId& */	private String csPrmtIssuanceId = new String();/* &PermitSearchKeys'csPrmtNo& */	private String csPrmtNo = new String();/* &PermitSearchKeys'csPrmtVIN& */	private String csPrmtVIN = new String();/* &PermitSearchKeys'serialVersionUID& */	static final long serialVersionUID = 7150852058736036569L;	/**	 * PermitSearchKeys.java Constructor	 * 	 *//* &PermitSearchKeys.PermitSearchKeys& */	public PermitSearchKeys()	{		csPrmtIssuanceId = new String();		csPrmtNo = new String();		csCustLstName = new String();		csCustBsnName = new String();		csPrmtVIN = new String();	}	/**	 * PermitSearchKeys.java Constructor	 * 	 * @param aaGSD  	 *//* &PermitSearchKeys.PermitSearchKeys$1& */	public PermitSearchKeys(GeneralSearchData aaGSD)	{		super();		String lsKey = aaGSD.getKey1();		String lsValue = aaGSD.getKey2();		if (lsKey.equals(CommonConstant.PRMT_PRMTNO))		{			csPrmtNo = lsValue;		}		else if (lsKey.equals(CommonConstant.PRMT_PRMTID))		{			csPrmtIssuanceId = lsValue;		}		else if (lsKey.equals(CommonConstant.PRMT_VIN))		{			csPrmtVIN = lsValue;		}		else if (lsKey.equals(CommonConstant.PRMT_BSNNAME))		{			csCustBsnName = lsValue;		}		else if (lsKey.equals(CommonConstant.PRMT_LSTNAME))		{			csCustLstName = lsValue;		}		if (aaGSD.getDate1() != null)		{			ciBeginDate = aaGSD.getDate1().getYYYYMMDDDate();		}		if (aaGSD.getDate2() != null)		{			ciEndDate = aaGSD.getDate2().getYYYYMMDDDate();		}	}	/**	 * Gets value of ciBeginDate	 * 	 * @return int	 *//* &PermitSearchKeys.getBeginDate& */	public int getBeginDate()	{		return ciBeginDate;	}	/**	 * Gets value of csCustBsnName	 * 	 * @return String	 *//* &PermitSearchKeys.getCustBsnName& */	public String getCustBsnName()	{		return csCustBsnName;	}	/**	 * Gets value of csCustBsnName	 * 	 * @return String	 *//* &PermitSearchKeys.getCustLstName& */	public String getCustLstName()	{		return csCustLstName;	}	/**	 * Gets value of ciEndDate	 * 	 * @return int	 *//* &PermitSearchKeys.getEndDate& */	public int getEndDate()	{		return ciEndDate;	}	/**	 * Gets value of csPrmtIssuanceId	 * 	 * @return String	 *//* &PermitSearchKeys.getPrmtIssuanceId& */	public String getPrmtIssuanceId()	{		return csPrmtIssuanceId;	}	/**	 * Gets value of csPrmtNo	 * 	 * @return String	 *//* &PermitSearchKeys.getPrmtNo& */	public String getPrmtNo()	{		return csPrmtNo;	}	/**	 * Gets value of csPrmtVIN	 * 	 * @return String	 *//* &PermitSearchKeys.getPrmtVIN& */	public String getPrmtVIN()	{		return csPrmtVIN;	}	/**	 * Sets value of ciBeginDate	 * 	 * @param aiBeginDate	 *//* &PermitSearchKeys.setBeginDate& */	public void setBeginDate(int aiBeginDate)	{		ciBeginDate = aiBeginDate;	}	/**	 * Sets value of csCustBsnName	 * 	 * @param asCustBsnName	 *//* &PermitSearchKeys.setCustBsnName& */	public void setCustBsnName(String asCustBsnName)	{		csCustBsnName = asCustBsnName;	}	/**	 * Sets value of csCustLstName	 * 	 * @param asCustLstName	 *//* &PermitSearchKeys.setCustLstName& */	public void setCustLstName(String asCustLstName)	{		csCustLstName = asCustLstName;	}	/**	 * Sets value of ciEndDate	 * 	 * @param aiEndDate	 *//* &PermitSearchKeys.setEndDate& */	public void setEndDate(int aiEndDate)	{		ciEndDate = aiEndDate;	}	/**	 * Sets value of csPrmtIssuanceId	 * 	 * @param asPrmtIssuanceId	 *//* &PermitSearchKeys.setPrmtIssuanceId& */	public void setPrmtIssuanceId(String asPrmtIssuanceId)	{		csPrmtIssuanceId = asPrmtIssuanceId;	}	/**	 * Sets value of csPrmtNo	 * 	 * @param asPrmtNo	 *//* &PermitSearchKeys.setPrmtNo& */	public void setPrmtNo(String asPrmtNo)	{		csPrmtNo = asPrmtNo;	}	/**	 * Sets value of csPrmtVIN	 * 	 * @param asPrmtVIN	 *//* &PermitSearchKeys.setPrmtVIN& */	public void setPrmtVIN(String asPrmtVIN)	{		csPrmtVIN = asPrmtVIN;	}}/* #PermitSearchKeys# */